import React, { useState, useEffect } from 'react';
import './Main.css';
import Header from './../Header/Header'
import Person from '../../Image/beer.jpg'
import reactIcon from '../../Image/react.png'
import awsIcon from '../../Image/aws.png'
import htmlIcon from '../../Image/html5.jpg'
import cssIcon from '../../Image/css.svg'
import npmIcon from '../../Image/npm.png'
import sassIcon from '../../Image/sass.svg'
const Main = (props) => {
    let tools = [
        {
            Image: reactIcon,
            Name: "React"
        },
        {
            Image: awsIcon,
            Name: "AWS"
        },
        {
            Image: htmlIcon,
            Name: "HTML5"
        },
        {
            Image: cssIcon,
            Name: "CSS3"
        },
        {
            Image: npmIcon,
            Name: "npm"
        },
        {
            Image: sassIcon,
            Name: "Sass"
        },
    ]
    let toolsIcons = []
    let toolsNames = []
    for (let i = 0; i < 6; i++) {

        toolsIcons.push(
            <div className="CardBackGridImageContainter">
                <img className="CardIconImage"
                    src={tools[i].Image}>
                </img>
            </div>
        )
        toolsNames.push(
            <div className="CardBackGridName">
                <p>{tools[i].Name}</p>
            </div>
        )

    }

    return (
        <div className="Main">
            <Header />
            <br />
            <div className="Card">
                <div className="CardFlip">
                    <div className="CardFlipFront">
                        <div>

                            <h1>Tools I use</h1>
                        </div>
                    </div>
                    <div className="CardFlipBack">
                        <div className="CardBackGrid CardBackGrid6">
                            {toolsIcons}
                            {toolsNames}

                        </div>
                    </div>
                </div>
            </div>
        </div>
    );




}
export default Main;
